import React from 'react';
import './Profile.css';
import { useUserContext } from '../context/UserContext';

const Profile = () => {

  const {UserId} = useUserContext();

  return (
    <div className='dash profile'>
      {/* profile top */}
      <div className="profile-top profile-cont">
         <div className="profile-top-head">
           <h2>Your Profile:</h2>
         </div>
          <div className="profile-top-info">

             <div className="profile-pic">
                <div className="profile-pic-main">

                </div>
                <div className="profile-pic-button">
                  <button>+ Update Photo</button>
                </div>
             </div>
             <div className="profile-info">
               <h2>Akash Kumar Das</h2>
               <p>Phone:- +91 9693195907</p>
               <p>Email:- rickak825@gmail.com</p>
             </div>

          </div>

      </div>
      {/* end profile top */}
      {/* profile bot */}
      <div className="profile-bot profile-cont">

      </div>
      {/* end profile bot */}
    </div>
  )
}

export default Profile
